snippet.textDisplay:
Suppose there is an algorithm A(P), that takes a machine code program P,  and returns True if P is a virus (creates new copies of P) and False otherwise. Now suppose you write a virus V that works like this: 
if A(V):
    while True:
        pass
else:
    spread()

If V is detected as a virus, then A goes into an infinite loop and never halts. If V is not detected as a virus, then it spreads. Therefore it is generally undecidable whether a given program is a virus. Also consider the case:

def encryptor(password):
    flash_MBR_with_decryptor()
    install_decryptor_driver()
    encrypt_hard_drive(password)
    reboot()

Is this malware? It depends. If the user knows the password, this is legitimate hard disk encryption software, and is useful for high-value targets. If the user *doesn't* know the password, this is ransomware and the user will probably get a text message asking for bitcoins. If you can't read the user's brain, you don't know if this is good or malicious.

